    "2016-04-06T23:21:39.505823",nt"name": "cdc-wonder-mortality-infant-deaths",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The Mortality - Infant Deaths (from Linked
    Birth / Infant Death Records) online databases on CDC WONDER provide counts and
    rates for deaths of children under 1 year of age, occuring within the United States
    to U.S. residents. Information from death certificates has been linked to corresponding
    birth certificates. Data are available by county of mother's residence, child's
    age, underlying cause of death, gender, birth weight, birth plurality, birth order,
    gestational age at birth, period of prenatal care, maternal race and ethnicity,
    maternal age, maternal education and marital status. Data are available since 1995.
    The data are produced by the National Center for Health Statistics.</p>n",nt"license_title":
